import {isAuth} from "../helpers/isAuth";
import {useEffect, useState} from "react";
import {useNavigate} from "react-router-dom";
import {IUser} from "../interfaces/user";
import axios from "axios";
import {IRequestConfig} from "../interfaces/global";

export default function Profile() {
    const navigate = useNavigate()

    const isAuthenticated = isAuth()
    useEffect(() => {
        if (!isAuthenticated) {
            navigate('/')
        }
    }, [isAuthenticated, navigate]);

    const [user, setUser] = useState<IUser | null>(null)
    const [loading, setLoading] = useState(true);
    // State to track any errors that may occur
    const [error, setError] = useState(null);

    useEffect(() => {
        // Call the fetchData function when the component mounts
        getUser();
    }, []);

    const getUser = async () => {
        axios.get(`${process.env.REACT_APP_SERVER_API_URI}/auth/me`, {
            headers: {
                Authorization: `Bearer ${localStorage.getItem(process.env.REACT_APP_AUTH_JWT)}`
            }
        } as IRequestConfig)
            .then(res => {
                console.log(res.data)
            })
            .catch(e => console.log(e))
    }

    return (
      <>
          <h1>profile page</h1>
      </>
    )
}
